    url: 'https://www.huffingtonpost.com/entry/southwest-airlines-flight-1380_us_5ad62dbce4b016a07ea11e71',
    title: 'Woman Partially Sucked Out Of Jet During Southwest Flight',
    body: 'A Southwest Airlines flight from New York City\'s LaGuardia Airport had to make an emergency landing on Tuesday after the plane became depressurized because of a broken window.\n\nA female passenger was reportedly partially sucked out of the plane as a result and had to be hospitalized.\n\n#UPDATE Window was blown out in the 17th row causing a loss of cabin pressure as the #Airplane made a rapid decompression and returned to the ground. The flight 1380 was from #NewYork #laguardia to #Dallas #LoveField in #Texas. Reports of a female passenger with serious injuries. pic.twitter.com/zE8rg0OP0R -- Scot Tanner Buchholz (@BScotTanner)\n\nApril 17, 2018\n\nFlight 1380 was scheduled to fly to Dallas but made an emergency stop in Philadelphia after an engine on the left side of the plane blew out.\n\nPassenger Marty Martinez told CBS Philadelphia that the sequence of events after the engine exploded was "terrifying."\n\n"The engine exploded and it broke a window," Martinez said. "First there was an explosion and almost immediately, the oxygen masks came down and, probably in a matter of 10 seconds, the engine then hit a window and busted it wide open."\n\nA man relaying information from his daughter-in-law, a passenger on the plane, told NBC Philadelphia that when the window imploded, a female passenger was partially sucked out of the plane, and other passengers needed to pull her back in.\n\nThe aircraft was flying around 32,500 feet when the engine blew out. Aviation expert Arthur Wolk told the station that the plane\'s rate of descent indicated that the pilot had control of the aircraft.\n\nThe injured woman was taken to a local hospital in critical condition, but no details of her injuries have been released. Seven people were treated for minor injuries.\n\nSouthwest Airlines released this statement about the emergency landing to HuffPost:\n\n"We are aware that Southwest flight #1380 from New York La Guardia (LGA) to Dallas Love Field (DAL) has diverted to Philadelphia International Airport (PHL). We are in the process of transporting Customers and Crew into the terminal.\n\n"The aircraft, a Boeing 737-700, has 143 Customers and five Crewmembers onboard. We are in the process of gathering more information. Safety is always our top priority at Southwest Airlines, and we are working diligently to support our Customers and Crews at this time."\n\nBoing responded with more information about the aircraft:\n\nUPDATED STATEMENT ON SWA FLIGHT #1380: Boeing is aware of the event and is providing technical assistance to the investigation. As per international protocol governing civil aviation investigations, questions about the investigation should be directed to the NTSB. -- Boeing Airplanes (@BoeingAirplanes)\n\nApril 17, 2018\n\nThe Federal Aviation Administration released this statement about the landing:\n\n#BREAKING FAA statement on Southwest Flight 1380 pic.twitter.com/FyPS7Mud0U -- Jeffrey Cook (@JeffreyCook)\n\nApril 17, 2018\n\nPassengers also posted photos on social media of the damaged plane.\n\n@SouthwestAir These are the hero\'s of SWA 1380 NYC to Dallas We lost an engine mid-flight and they guided back to Philly saved 149 on board pic.twitter.com/RNA8sXRBZA -- Kristopher Johnson (@EMMS_MrJohnson)\n\nApril 17, 2018',
