  eventDate: '2018-03-20',
  title: 
   { eng: 'F.T.C. Investigating Facebook in Use of Personal Data by Firm Tied to Trump',
     fra: 'L\'affaire Cambridge Analytica plonge Facebook dans une crise historique',
     spa: 'Facebook está enfrentando una crisis existencial con el escándalo de Cambridge Analytica',
     rus: 'Марк Цукерберг за сутки потерял $6 млрд',
     por: 'Escândalo coloca Facebook na mira dos governos dos EUA e Reino Unido',
     zho: '連是不是談遠距戀愛 Facebook 都追蹤，科技巨頭用隱私煉金',
     ita: 'Facebook: Kogan, io capro espiatorio, tutti sapevano tutto  - Internet e Social',
     cat: 'El fundador de Facebook, cridat a declarar al Parlament británic',
     ukr: 'Вибори і Донбас: як Cambridge Analytica впливала на Україну' },
  summary: 
   { eng: 'The Federal Trade Commission has opened an investigation into whether Facebook violated an agreement with the agency on data privacy, after reports that information on 50 million users was improperly obtained by the political consulting firm Cambridge Analytica, according to a person with knowledge of the inquiry.\n\nThe investigation, started in recent days, adds to the mounting pressure against Facebook in the United States and in the United Kingdom about its handling of the data. Cambridge Analy',
     fra: 'Aux Etats-Unis, les responsables politiques des deux bords réclament que le PDG du réseau social s\'explique devant le Congrès, après les révélations sur l\'utilisation des données personnelles.\n\nFacebook est en train d\'affronter l\'une des pires crises de son histoire. De virulentes critiques fusent des deux côtés de l\'Atlantique à l\'encontre du réseau social, trois jours après les révélations du Guardian et du New York Times au sujet de Cambridge Analytica, une entreprise ayant joué',
     spa: 'El escándalo de Cambridge Analytica le ha ocasionado un daño inmenso a la marca, creen fuentes en toda la compañía. Ahora harán un esfuerzo herculano para restaurar la confianza del público en el compromiso de Faceboook con la privacidad y la protección de datos, dicen ellos. Observadores externos piensan que la regulación se ha vuelto más probable de repente y el presidente ejecutivo, Mark Zuckerberg, parece haber desaparecido en acción.\n\nEl escándalo también resalta un problema que ',
     rus: 'Создатель Facebook Марк Цукерберг 19 марта потерял $6 млрд. Причиной стала новость об утечке данных о пользователях социальной сети\n\nКак сообщает CNBC, акции Facebook в понедельник 19 марта упали на 8%. Причиной стала появившаяся в выходные информация о том, что компания Cambridge Analytica, котор',
     por: 'Nesta semana, o Facebook tem sido atingido por todos os lados após a revelação de que uma empresa de marketing chamada Cambridge Analytica teve acesso indevido a dados de 50 milhões de usuários. Agora, a rede social está na mira dos governos dos Estados Unidos e do Reino Unido.\n\nSegundo fontes da agência Bloomberg, a Comissão Federal do Comércio dos EUA (FTC, na sigla em inglês) abriu um inquérito para apurar se o Facebook rompeu com um acordo estabelecido em 2011 que previa certos cui',
     zho: '對於 Facebook 會蒐集個人資料這種事情，多數大概都略知一二。有的用戶可能會注意最近跳出來的廣告，和自己搜尋過的內容或點擊過的貼文有關。不過大部分的人應該還是不知道 Facebook 蒐集的內容有多誇張，隱私搜尋引擎 search encrypt 列出了 98 項 Facebook 追蹤的內容，看了就知道 Facebook 有多變態。\n\n其中自然有地點、年齡、性別和語言這種基本資料，還有學歷和工作這類多數人',
     ita: 'LONDRA - "Mi usano come capro espiatorio, sia Facebook sia Cambridge Analytica", ma la verità è che tutti sapevano tutto e tutti "ritenevamo di agire in modo perfettamente appropriato" dal punto di vista legale. Alexander Kogan, accademico americano figlio d\'espatriati sovietici e docente di psicologia a Cambridge, non ci sta rimanere con il cerino in mano sullo scandalo del momento. E replica dai microfoni di Bbc Radio 4. E\' lui, attraverso una sua app, l\'uomo che ha raccolto ed elaborato i da',
     cat: 'El fundador de Facebook, Mark Zuckerberg ha estat cridat oficialment aquest dimarts pel parlament britànic perquè acudeixi a declarar sobre l\'ús de dades personals de 50 milions d\'usuaris de la coneguda xarxa social per part de la companyia d\'anàlisi política Cambridge Analytica, amb seu central a Londres però fundada l\'any 2013 per un generós donant del Partit Republicà, Robert Mercer, i per l\'ideòleg de la campanya presidencial de Donald Trump, Steve Bannon. Informacions publicades aqu',
     ukr: 'Це зовнішні посилання і відкриються в новому вікні\n\nУ США та Європі розгорається скандал навколо використання британською компанією Cambridge Analytica персональних даних із соціальних мереж для впливу на вибори. Фігурує у цьому скандалі й Україна.\n\nСоціальна мережа Facebook передава' },
