  title: 
   { eng: 'Deadly fire in Russian shopping mall kills 64, many of them children',
     zho: '俄罗斯商场大火至少64死 大多数为儿童',
     deu: 'Feuer in Einkaufszentrum: 64 Tote bei Brand - Wachmann soll Alarm ausgeschaltet haben - WELT',
     spa: 'Al menos 37 muertos tras un incendio en un centro comercial en Rusia',
     fra: 'Incendie meurtrier en Sibérie : Poutine dénonce une "négligence criminelle"',
     por: '\'Estamos queimando. Amo vocês\', escreveu vítima de incêndio em shopping center na Rússia',
     tur: 'Rusya\'da facia! AVM\'de yangın çıktı: En az 48 ölü!',
     rus: 'Аман Тулеев нашел в протестах внешнее вмешательство',
     cat: 'La ràbia per la negligència al centre comercial encén els ànims de Sibèria',
     slv: 'Smrtne žrtve v požaru v nakupovalnem centru v Sibiriji' },
  summary: 
   { eng: 'MOSCOW -- At least 64 people, many of whom are believed to be children, perished in the Siberian city of Kemerovo on Sunday as a massive fire swept through a crowded shopping center.\n\nAnother 40 more victims were treated on site, and at least 10 others have been hospitalized, according to Russia\'s Ministry of Health. Rescuers are also still searching for almost 60 missing people -- most of them children. Kemerovo is nearly 2,000 miles east of Moscow.\n\nSunday was the first day of a week-long schoo',
     zho: '这是外部链接，浏览器将打开另一个窗口\n\n俄罗斯西伯利亚中部的工业城克麦洛伏市（Kemerovo）的一购物中心周日（3月25日）发生大火，造成至少64人死亡，其中大多数为儿童。\n\n俄罗斯官方表示，死者中有很多儿童，至少10人仍失踪。\n\n该国调查委员会说，这座商场的安全出口被堵塞，存在"严重违规问题"。\n\n发生火灾时，大楼内商店，电影院和保龄球厅挤满了顾客。\n\n社交媒体上',
     deu: 'Sie wollten einen schönen Nachmittag im Kino verbringen und freuten sich über den Start ihrer Ferien. Am Sonntag besuchten zahlreiche Kinder mit ihren Eltern ein Kino im sibirischen Kemerowo. Doch dann brach in dem Einkaufszentrum, in dem sich das Kino befand, ein Feuer aus. 64 Menschen starben in den Flammen. Nun haben Ermittler den Wachmann des Einkaufszentrums im Visier. Er soll den Feueralarm deaktiviert haben.\n\nDer Mann habe den Alarm ausgeschaltet, nachdem er ein Signal über Feuer im Geb',
     spa: 'Al menos 37 personas murieron el domingo en un incendio que destruyó un centro comercial en la ciudad siberiana de Kemerovo, en el sudeste de Rusia.\n\nFuncionarios de emergencia locales informaron que otras tres decenas de personas están desaparecidas y que entre ellas podría haber niños.\n\nEl incendio comenzó en el cuarto piso del edificio Winter Cherry y muchas de las víctimas estaban en un cine.\n\nUn video publicado en las redes sociales muestra que varias personas saltaban de las ventanas ',
     fra: 'Vladimir Poutine a dénoncé mardi l\'incendie meurtrier qui a fait au moins 64 morts dans un centre commercial de Sibérie.\n\nPour le président russe, les 64 personnes dont 41 enfants qui ont péri dans l\'incendie d\'un centre commercial à Kemerovo, en Sibérie, sont mortes "à cause de négligence criminelle, de laisser-aller", selon des propos retransmis mardi par le Kremlin. La veille, les autorités russes ont dénoncé de graves négligences et des violations des normes de sécurité.\n\nLes e',
     por: 'Adolescentes \'desaparecidas\' após tragédia mandaram mensagens a parentes\n\npor O Globo / Agências internacionais\n\n26/03/2018 12:48 / Atualizado 26/03/2018 13:09\n\nMOSCOU -- Adolescentes citados em uma lista de pessoas desaparecidas que está sendo divulgada pela imprensa russa após o incêndio no shopping Winter Cherry, em Kemerovo, na Rússia, entraram em contato com suas famílias durante os momentos de pânico. Pelo menos 64 pessoas morreram em decorrência das chamas que destruíram o centr',
     tur: 'Rusya\'nın orta güney kesiminde bulunan Kemerovo şehrinde bir alışveriş merkezinde yangın çıktı. Son dakika habere göre, korkunç yangında en az 48 kişi öldü. Olayda 50\'den fazla kişinin yaralandığı ve onlarca kişinin kayıp olduğu bildirildi.\n\nRusya Soruşturma Komitesi\'nden yapılan açıklamada, şehir merkezinde bulunan alışveriş merkezinde çıkan yangında ölü sayısının 48\'e ulaştığı kaydedildi. Yerel basında çıkan haberlere göre 50\'den fazla kişinin yar',
     rus: 'В своем обращении к жителям Кемеровской области губернатор региона Аман Тулеев заявил, что "определенные силы пытаются стравить людей и нажиться на чужом горе". До этого его заместитель Владимир Чернов назвал многотысячный митинг, который прошел в Кемерово 27 марта, "четко ',
     cat: 'La ràbia per les nul·les mesures de seguretat i la falta d\'informació ha escalfat els ànims entre els familiars de les víctimes de l\'incendi que diumenge va destruir un centre comercial de la ciutat siberiana de Kémerovo. Centenars de persones han sortit als carrers amb fotografies de les víctimes per mostrar el seu enuig i exigir dimissions pels responsables de la tragèdia. A causa del foc van morir 64 persones, de les quals 41 són menors d\'edat, segons les llistes difoses aquest dimart',
     slv: 'Moskva, 25. marca (STA) - V nakupovalnem centru industrijskega mesta Kemerov v Sibiriji je zagorelo. Umrle so najmanj štiri osebe, od tega trije otroci, 26 ljudi so morali odpeljati v bolnišnico, so danes po poročanju francoske tiskovne agencije AFP sporočile tamkajšnje oblasti. Pristojne oblasti domnevajo, da je požar izbruhnil v predelu nakupovalnega središča, kjer sta kinematograf in igrišče za otroke. Požar naj bi se razširil na skupno več kot tisoč kvadratnih metrov. V gašenju' },
