  title: 
   { eng: 'China\'s \'space dream\': A long walk to the moon',
     zho: '"天空一号"坠落 器件烧蚀尚无人员伤亡',
     fra: 'Une station spatiale chinoise va s\'écraser sur Terre ce week-end: existe-t-il un risque?',
     spa: 'Laboratorio espacial chino Tiangong-1 cae a la Tierra',
     deu: 'Chinas Raumstation "Tiangong-1" abgestürzt und verglüht',
     por: 'Estação espacial chinesa deve cair nas próximas horas na Terra',
     tur: 'İstanbul\'u da tehdit eden Çin uzay istasyonu Tiangong-1 paramparça oldu! - Teknoloji Haberleri',
     ita: 'La Stazione spaziale cinese rientrata sul Pacifico VIDEO - Scienza & Tecnica',
     slv: 'Nebeška palača zgorela ob vstopu v ozračje' },
  summary: 
   { eng: 'The plunge back to Earth of a defunct Chinese space laboratory will not slow down Beijing\'s ambitious plans to send humans to the moon.\n\nThe Tiangong-1 space module, which crashed was intended to serve as a stepping stone to a manned station, but its problems highlight the difficulties of exploring outer space.\n\nBut China has come a long way in its race to catch up with the United States and Russia, which have lost spacecraft, astronauts and cosmonauts over the decades.\n\nChina\'s "taikonauts" have',
     zho: '这是外部链接，浏览器将打开另一个窗口\n\n中国新华社周一（4月2日）援引北京航天飞行控制中心和有关机构监测分析称，中国失控空间站"天宫一号"目标飞行器已于4月2日8时15分左右再入大气层。\n\n再入落区位于南太平洋中部区域，绝大部分器件在再入大气层过程中烧蚀销毁。目前尚无人员伤亡报道。\n\n"天宫一号"于2011年发射，初衷是作为其他飞行器的接合点，是中国计划在2022',
     fra: 'La station Tiangong-1 doit entrer dans l\'atmosphère terrestre dimanche soir au plus tôt, selon les spécialistes. L\'incertitude demeure quant à la possibilité de voir des débris atteindre la surface de la planète. Auquel cas, le sud de la France, la Corse, et certains territoires d\'outre-mer feraient partie des zones potentiellement concernées.\n\nLa fin de son voyage est prévue pour ce week-end. La station spatiale chinoise Tiangong-1 s\'apprête à effectuer une rentrée non contrôlée da',
     spa: '(CNN) - El laboratorio espacial Tiangong-1 de China reingresó a la atmósfera de la Tierra alrededor de las 8:15 am el lunes hora de Beijing (domingo 8:15 pm ET) y cayó al Pacífico sur, dijo la agencia espacial china en un comunicado.\n\nEl comunicado dice que "la mayoría de partes se quemaron en el proceso de reingreso".\n\nTiangong-1 es llamado el "Heavenly Palace" (Palacio Celestial) y mide de 12 metros de largo.\n\nMIRA: Astrónomo aficionado descubre un satélite de la NASA que había estado p',
     deu: 'Es kam wie erhofft: Die außer Kontrolle geratene chinesische Raumstation "Tiangong-1" stürzte auf die Erde ohne großen Schaden anzurichten. Sie trat über dem Südpazifik in die Erdatmosphäre ein.\n\nDie chinesische Raumstation "Tiangong-1" ist auf die Erde gestürzt. Das acht Tonnen schwere Weltraumlabor sei dabei "größtenteils" verglüht, teilte die chinesische Raumfahrtbehörde CMSEO mit.\n\nDie gut zehn Meter lange "Tiangong" (zu deutsch: Himmelspalast) sei um 08.15 Uhr Pekinger Zeit (02.15',
     por: 'Tiangong-1, o Palácio Celestial, foi lançada em 2011 e está desabitada desde 2013 China Manned Space Agency\n\nA Agência Espacial Europeia (ESA, na sigla em inglês) reafirmou, em seu boletim deste domingo (1º), que a estação espacial chinesa Tiangong-1, que está em queda descontrolada no espaço, deve reentrar na atmosfera terrestre nas próximas horas.\n\nA reentrada é prevista, segundo o último boletim, desde a madrugada deste domingo até as primeiras horas da manhã da segunda-feira (2',
     tur: 'Çin İnsanlı Uzay Mühendisliği Bürosu\'ndan (CMSEO) yapılan açıklamada, Pazartesi gece yarısı itibariyle Tiangong-1\'in atmosfere yeniden giriş yapacağı belirtilmişti.\n\nUzay aracının düşebileceği yerler arasında Türkiye de bulunuyordu. İtalya, İspanya, Japonya, Kore de uzay aracının infilak edebileceği yerler arasındaydı.\n\n2013\'te görev süresi bitmişti\n\nÇin\'in 2011\'de fırlattığı 8,5 ton ağırlığındaki Tiangong-1 (Gök Sarayı) isimli uzay istasyonu 2013\'te g',
     ita: 'Dopo 2.375 giorni e 21 ore in orbita, la stazione spaziale cinese Tiangong 1 ha concluso la sua caduta libera sul Pacifico meridionale, rientrando nell\'atmosfera prima di poter tornare a \'salutare\' l\'Italia. Il suo nome significa \'Palazzo celeste\' e la sua storia è stata seguita da telescopi e radar di almeno 12 agenzie spaziali e centri di ricerca di tutto il mondo.\n\nIl video del rientro nel 2008 della prima navetta automatica Atv, dell\'Agenzia Spaziale Europea, confrontabile per dimensioni all',
     slv: 'Nekaj manjših delcev pa je padlo v ocean okoli 100 kilometrov severozahodno od Tahitija.\n\nVečina odslužene kitajske vesoljske postaje Tiangong-1 je zgorela ob vstopu v Zemljino ozračje nekje sredi južnega Pacifika, so po poročanju Reutersa sporočile kitajski oblasti. Najprej so sicer predvideli, da bi postaja Zemljino ozračje vstopila blizu brazilske obale nad južnim Atlantikom.\n\nTudi ameriška postaja, ki nadzoruje in sledi neznane objekte v zemeljski orbiti, je poročala, da je ob pomo' },
