  eventDate: '2018-03-27',
  title: 
   { eng: 'Facebook to change privacy controls in wake of data scandal',
     spa: 'Steve Jobs le advirtió a Mark Zuckerberg sobre la importancia de la privacidad | ELESPECTADOR.COM',
     fra: 'Voici comment consulter tout ce que Facebook sait de vous ',
     por: 'Facebook monitora usuários de 41% dos apps mais populares do Android',
     ita: 'Facebook vara nuovi strumenti per il controllo della privacy' },
  summary: 
   { eng: 'The measures come ahead of a landmark European Union data protection law in May.\n\nFacebook announced a series of changes on Wednesday to give users more control over their data, after a huge data scandal which has wiped more than $100 billion from its stock market value. The company has faced a global outcry after a whistleblower revealed, on March 17, that data from 50 million users was improperly harvested to target US and British voters in close-run elections.\n\n"The last week showed how much m',
     spa: 'El escándalo de Cambridge Analytica revivió el mensaje que le mandó el creador de Apple al fundador de Facebook durante una entrevista de 2008.\n\nFacebook sigue en el ojo del huracán luego que la semana pasada se conociera el escándalo de Cambridge Analytica, que reveló la utilización de los datos de 50 millones de usuarios con fines políticos. El malestar ha llegado al punto que empresas como Playboy, Tesla y Space X decidieron eliminar sus fanpages para apoya el movimiento #DeleteFaceboo',
     fra: 'Le scandale Cambridge Analytica nous rappelle à quel point Facebook est un espion qui pille et distribue nos données.\n\nFacebook est au cœur de la polémique. En cause: le scandale Cambridge Analytica.\n\nCette firme britannique a détourné et décortiqué les données de millions d\'utilisateurs à l\'heure d\'orienter la communication des campagnes Trump et pro-Brexit.\n\n"Sans Cambridge Analytica, il n\'y aurait pas eu de Brexit", clame le lanceur d\'alerte Christophe Wylie.\n\nCe tourbillon éclabous',
     por: 'Nos últimos tempos, tem ganhado força a campanha #DeleteFacebook, um boicote à rede social pelo modo como a empresa permitiu que dados de milhões de usuários caíssem nas mãos da consultoria Cambridge Analytica sem autorização. O problema é que não é tão fácil assim se livrar dos olhos do Facebook.\n\nSegundo uma pesquisa da AdGuard, quase metade dos aplicativos mais populares do Google Play utilizam o Facebook Audience Network. Essa ferramenta tem duas funções importantes para desen',
     ita: 'ROMA - Rendere chiari e visibili in un solo posto della piattaforma tutti gli strumenti per controllare la privacy, la possibilità di cancellare definitivamente post passati dalla piattaforma, velocizzare e rendere più selettivo il processo di download della propria storia sul social network. Sono le novità che Facebook mette a disposizione degli utenti, in aggiunta agli annunci di Mark Zuckerberg all\'indomani del caso Cambridge Analytica. in cui il social in blu è accusato di non aver vigila' },
