  eventDate: '2018-03-22',
  title: 
   { eng: 'Zlatan Ibrahimovic has left Manchester United',
     fra: 'Officiel : Manchester United annonce le départ de Zlatan Ibrahimovic !',
     spa: 'LA Galaxy confirma traspaso de Zlatan Ibrahimovic',
     deu: 'Transfermarkt: Zlatan Ibrahimovic verlässt Manchester United',
     rus: 'Ибрагимович перешёл в "Лос-Анджелес Гэлакси"',
     por: 'Ao lado de "leão", Ibrahimovic é anunciado oficialmente no Los Angeles Galaxy',
     ita: 'Ibrahimovic nella MLS, ecco l\'annuncio',
     tur: 'Ibrahimovic LA Galaxy\'ye transferini ilginç bir şekilde duyurdu',
     hrv: 'Ibrahimović se oprostio od navijača Uniteda' },
  summary: 
   { eng: 'Zlatan Ibrahimovic has left Manchester United after two seasons with the club.\n\nThe veteran Swedish striker will is set to MLS outfit LA Galaxy as he prepares to bring down the curtain on a glorious career.\n\nUnited issued a statement on their website on Thursday afternoon, saying: "Manchester United confirms that it has agreed to the termination of Zlatan Ibrahimovic\'s contract with immediate effect.\n\n"Everyone at the club would like to thank Zlatan for his contribution to the team since his arri',
     fra: 'Manchester United vient de publier un communiqué sur son site officiel pour annoncer que Zlatan Ibrahimovic venait de résilier son contrat. Le Suédois est donc désormais libre de s\'engager pour le club de son choix. La tendance est à un départ vers la MLS, où Los Angeles l\'attend à bras ouverts.\n\nC\'était dans l\'air, c\'est désormais officiel : Zlatan Ibrahimovic (36 ans) quitte Manchester United. Le club mancunien vient de publier un communiqué officiel sur son site pour annoncer la nou',
     spa: 'Los Angeles (AFP) -\n\nZlatan Ibrahimovic y Los Angeles Galaxy confirmaron el traspaso de la estrella sueca en un anuncio publicado en el diario Los Angeles Times.\n\n"Querido Los Angeles, eres bienvenido", dice el enigmático anuncio de una página, junto a la firma de Ibrahimovic y el logo del Galaxy.\n\nEn tanto, una foto del jugador de 36 años de edad luciendo la casaca del LA Galaxy aparece encima de una nota separada en la primera página de la sección de Deportes del diario.\n\nEl traspaso de Ib',
     deu: 'Zlatan Ibrahimovic spielt nicht mehr bei Manchester United. Der Vertrag des schwedischen Torjägers wird vorzeitig aufgelöst.\n\nSuperstar Zlatan Ibrahimovic hat seinen Vertrag beim englischen Rekordmeister Manchester United mit sofortiger Wirkung aufgelöst und steht nun wohl vor einem Wechsel in die amerikanische Profiliga MLS. United bestätigte die Beendigung der Zusammenarbeit mit dem schwedischen Ausnahmestürmer am Donnerstag.\n\n"Auch großartige Dinge kommen zu einem Ende, es ist Zeit, nach',
     rus: '"Лос-Анджелес Гэлакси" объявил о подписании Златана Ибрагимовича в качестве свободного агента.\n\nШведский нападающий будет выступать под 9 номером.\n\n"После того, как в Европе мне удалось завоевать 33 трофея, играя в лучших командах мира, имея лучших игроков в мира в качестве па',
     por: 'Com a companhia de um "leão", Zlatan Ibrahimovic foi anunciado oficialmente pelo Los Angeles Galaxy em um vídeo inusitado nas suas redes sociais. O atacante sueco, de 36 anos, vai ter um contrato de dois anos. Os valores não foram divulgados, mas a imprensa local especula que Ibra receberá cerca de 1,2 milhão de euros por ano.\n\n+ Ibrahimovic compra página de jornal e brinca com sua chegada aos EUA\n\nEm nota oficial, o Galaxy disse que a intenção de trazer Ibra começou há três anos, quan',
     ita: 'Banalità e Zlatan Ibrahimovic: un binomio introvabile nella carriera dell\'attaccante svedese. Che per annunciare il suo trasferimento nella Major League Soccer, la prima serie del calcio statunitense, ha optato per un\'idea singolare: acquistare una pagina di giornale con sfondo completamente bianco e firmarla. A modo suo.\n\nZlatan Ibrahimovic has taken out a full page advert in the @latimes announcing his arrival at LA Galaxy. Classic Zlatan. pic.twitter.com/TeFXM2De7e -- Dale Johnson (@DaleJohns',
     tur: 'İngiltere Premier Lig ekiplerinden Manchester United ile sözleşmesini fesheden İsveçli yıldız golcü Zlatan Ibrahimovic, kendisini destekleyenlere teşekkür etti. Zlatan Ibrahimovic, ABD birinci futbol ligi MLS ekiplerinden Los Angeles Galaxy\'ye transferini ilginç bir şekilde duyurdu.\n\nSosyal paylaşım sitesi Twitter ile Instagram hesaplarından açıklamada bulunan 36 yaşındaki golcü, sevenlerine veda ederek, "Güzel şeylerin de bir sonu var ve harika iki sezonun ardından Manches',
     hrv: 'Zlatan Ibrahimović je nakon manje od dvije godine napustio Manchester United. Jedan od najvećih klubova svijeta danas je službeno potvrdio rastanak sa švedskim napadačem, tri mjeseca prije isteka ugovora.\n\nIbrahimović je na Old Trafford stigao 2016. godine bez odštete iz PSG-a, bio je najbolji igrač Uniteda u prvoj sezoni koju nije završio zbog teške ozljede prošlog travnja. Nakon operacije i višemjesečnog oporavka vratio se nogometu u prosincu, ali nova ozljeda spriječila je njegov' },
