  title: 
   { eng: 'Putin, Erdogan and Rouhani to discuss Syrian crisis in Ankara ',
     deu: 'Putin in Ankara: Russland und Türkei bauen strategische Kooperation in Wirtschaft und Militär aus',
     rus: 'Турция выдала разрешение на строительство АЭС "Аккую"',
     fra: 'L\'Iran, la Turquie et la Russie main dans la main face à l\'Occident',
     spa: 'Qué hay detrás de la ayuda de Rusia en la construcción de la primera central nuclear de Turquía',
     slv: 'Erdogan in "prijatelj" Putin zagnala gradnjo jedrske elektrarne' },
  summary: 
   { eng: 'Leaders of Russia, Turkey and Iran to hold talks to end the conflict amid rapid developments on the ground.\n\nTurkey will host a trilateral meeting on the Syrian crisis with the attendance of presidents of Turkey, Russia and Iran on Wednesday amid significant developments happening on the ground in the seven-year civil war.\n\nRussian President Vladimir Putin arrived in Ankara on Tuesday, followed by Iranian President Hassan Rouhani in the evening, as the leaders meet for the second time since Novem',
     deu: 'Beim ersten Auslandsbesuch seit seiner Wiederwahl im März einigte sich Wladimir Putin mit dem türkischen Präsidenten Recep Tayyip Erdogan auf eine Ausweitung der wirtschaftlichen sowie militärischen Zusammenarbeit. Auch der Bau des AKW Akkuyu hat begonnen.\n\nAuf einer Pressekonferenz in Ankara kündigte Putin an, dass Russland seine Liefertermine für die S-400-Verteidigungssysteme, die gemäß einem bereits unterzeichneten Vertrag zwischen beiden Ländern ursprünglich für Dezember avisiert ',
     rus: 'Агентство по атомной энергетике Турции выдало лицензию на строительство первого блока АЭС "Аккую", передает Anadolu.\n\nКак отмечается, проект АЭС был признан регулятором соответствующим всем принятым в Турции требованиям.\n\nПри этом ожидается, что церемония по закладке фундамен',
     fra: 'Les présidents turc, russe et iranien ont plaidé pour un "cessez-le-feu durable" en Syrie, à l\'issue d\'un sommet qui les a réunis au Palais présidentiel, à Ankara, selon le communiqué publié à l\'issue de la réunion. Une fois cet objectif affiché, les déclarations des trois chefs d\'Etat lors de leur conférence de presse commune indiquaient que chacun poursuivait ses propres obsessions. Recep Tayyip Erdogan a répété l\'équivalence, selon lui, entre les terroristes de l\'Etat islamiqu',
     spa: 'De pie, en el palacio presidencial en Ankara, el presidente de Turquía Recep Tayyip Erdogan ordenó este martes el comienzo de la construcción de Akkuyu, la primera planta de energía nuclear en su país.\n\nA su lado estaba Vladimir Putin, presidente de Rusia, de donde es originaria la empresa Rosatom, principal constructora de este complejo que costará más de US$20.000 millones.\n\nA través de una pantalla de video, ambos vieron como a unos 500 kilómetros de ahí, en la región de Mersin cerc',
     slv: 'Ruski predsednik Vladimir Putin je prišel v Turčijo na vrh za rešitev sirske vojne, še prej pa se je srečal s turškim kolegom Recepom Tayyipom Erdoganom.\n\nPredsednika sta slovesno zagnala gradnjo prve jedrske elektrarne v Turčiji, ki jo je začel snovati ruski velikan Rosatom. Putin je stal ob Erdoganu, ko je ta iz predsedniške palače v Ankari po videopovezavi odredil začetek gradnje jedrske elektrarne v Akkuyu na jugu države. Delavci so takoj začeli vlivati beton na gradbišču. Grad' },
