  title: 
   { eng: 'Israel cuts fresh water supplies to Gaza',
     spa: 'Día Mundial del Agua, un día ingrato para Chile',
     zho: '小手传爱利他 台二重国小送水到非洲 - 大纪元',
     fra: 'Journée mondiale de l\'eau : Quelles approches pour la gestion d...',
     por: '"Água é direito e não mercadoria", diz crítico de propostas de privatização',
     deu: 'Weltwassertag: Schmutzwasser Schuld an hoher Kindersterblichkeit - Vatican News' },
  summary: 
   { eng: 'Israel has been cutting drinking water supplies for the Gaza Strip since last Wednesday, Quds Press reported on Monday. The move was made without any prior notice being given.\n\n"Mekorot, the Israeli water supplier, told us last Wednesday that they would cut water for a couple of hours for maintenance purposes," explained Maher Salem, the Director of Gaza\'s Water Authority. "Since then, the water has been off. The pumping of water was not resumed as was agreed with them. This has affected the dist',
     spa: 'Este Jueves 22 de marzo se conmemora un nuevo Día Mundial del Agua. Esta efeméride fue establecida por Naciones Unidas como incentivo a la reflexión de la importancia del agua dulce y la necesidad de una gestión sostenible de ésta.\n\nEste día resulta ser particularmente sensible para Chile, pues su modelo de gestión puede ser calificado de muchas maneras, menos de sostenible. Y es que el Estado chileno ha optado insistentemente en ir contra la corriente al instaurar durante la dictadura cí',
     zho: '【大纪元2018年03月21日讯】（大纪元记者赖月贵台湾新竹报导）台湾新竹县二重国小20日举办"小手传爱，送水到非洲"活动，进行水资源讲座及体验课程，由五年级学生担任种子，向全校师生及家长宣导水的重要性，并进行募款，希望能帮助非洲人民打造一口水井，让他们拥有干净的饮用水。校长王富美期勉学生，在此活动中学习到无私的利他精神。\n\n二重国小校长王富美表示，',
     fra: 'Elément à la fois indispensable à l\'Homme et à l\'industrie, la gestion de l\'eau est souvent perçue comme secondaire en Afrique au regard des impératifs de développement. 22 mars journée mondiale de l\'eau, une opportunité pour repenser la réflexion sur les problématiques d\'accès à l\'eau sur le continent Africain\n\nLe continent africain dispose de grands fleuves, d\'une centaine de lacs une centaine de grands lacs auxquels s\'ajoutent plus de 600 000 kilomètres cubes de réserves d\'eau. ',
     por: 'Está acontecendo em Brasília a 8ª edição do Fórum Mundial da Água (FMA). O evento, que vai até esta quinta-feira (23), reúne governantes, empresários, pesquisadores e sociedade civil.\n\nRealizado a cada três anos, o FMA é uma iniciativa do Conselho Mundial da Água, uma organização com sede na França e que envolve mais de 300 entidades de mais de 50 países. Fundado em 1996, o conselho procura influenciar os tomadores de decisão de alto nível quanto a políticas públicas referent',
     deu: 'Die Kinderrechtsorganisation Save the Children verkündet zum Weltwassertag, dass die größte Ursache für Kindersterblichkeit Krankheiten sind, die durch verschmutztes Wasser übertragen werden. Wie auch das Kinderhilfswerk der Vereinten Nationen UNICEF betont, seien es rund 700 Kinder pro Tag, die den vermeidbaren Krankheiten zum Opfer fallen.\n\nKrankheiten, die durch dreckiges Wasser übertragen werden, sind zum Beispiel Cholera, Ruhr, Typhus, Kinderlähmung oder Diarrhö. Nach Daten von UNICE' },
