  title: 
   { eng: 'Last male northern white rhino dies',
     spa: 'Muere Sudán, el último rinoceronte blanco del norte macho que quedaba en el mundo',
     deu: '\'Sudan\': Letztes männliches nördliches Breitmaulnashorn der Welt ist in Kenia gestorben',
     fra: 'La mort de Sudan condamne l\'espèce des rhinocéros blancs du Nord',
     rus: 'Северный белый носорог. Досье',
     por: 'Morreu o último rinoceronte-branco-do-norte macho',
     ita: 'Kenya: morto ultimo rinoceronte bianco settentrionale maschio',
     hrv: 'Uginuo je Sudan: Cijela vrsta ostala je samo na dvije ženke',
     slv: 'Uspavali zadnjega samca severnega belega nosoroga' },
  summary: 
   { eng: 'The world\'s last surviving male northern white rhino has died after months of ill health, his carers said.\n\nSudan, 45, lived at the Ol Pejeta Conservancy in Kenya. He was put to sleep on Monday after age-related complications worsened significantly.\n\nHis death leaves only two females - his daughter and granddaughter - of the subspecies alive in the world.\n\nHope for preserving the northern white rhino now lies in developing in vitro fertilisation (IVF) techniques.\n\nRhinoceroses - of which there ar',
     spa: 'El último rinoceronte blanco del norte macho del mundo murió este lunes tras meses de enfermedad, dijeron sus cuidadores.\n\nSudán, como se llamaba el ejemplar, tenía 45 años y vivía en la reserva Ol Pejet, en Kenia.\n\nFue sacrificado el lunes después de que sus complicaciones relacionadas con la edad empeoraran considerablemente.\n\nSu muerte deja solo dos rinocerontes hembras de su subespecie en el mundo: su hija y su nieta.\n\nEl rinoceronte, cuya edad era equivalente a los 90 años de los ser',
     deu: 'Das letzte männliche Nördliche Breitmaulnashorn der Welt war oft zu schwach, um umher zu laufen. Leise schnaufend lag Sudan im Schatten in seinem Gehege in einem Wildtierreservat in Kenia. Seine Ohren drehten sich wie kleine Satellitenschüsseln in alle Richtungen, wohl neugierig, was der ganze Trubel um ihn herum soll. Immer wieder hob er seinen großen Kopf mit den zwei Hörnern, die so viele seiner Artgenossen das Leben gekostet haben. Im hohen Alter von 45 Jahren ist Sudan - genannt nach de',
     fra: 'Le dernier rhinocéros blanc du Nord mâle est mort au Kenya lundi 19 mars. Victime du braconnage, cette espèce est condamnée puisqu\'il ne reste plus désormais que deux femelles en vie sur la planète.\n\n"Il fut un illustre ambassadeur de son espèce. Pour tout ce qu\'il a accompli pour sensibiliser le monde au triste sort des rhinocéros, mais aussi à celui des milliers d\'autres espèces menacées d\'extinction à cause des activités humaines, Sudan laissera un souvenir impérissable."\n\nCité ',
     rus: 'Последний в мире самец северного белого носорога по кличке Судан\n\nТАСС-ДОСЬЕ. 19 марта 2018 года в Кении в заповеднике Ол Паджета умер последний в мире самец северного белого носорога по кличке Судан. Животному было 45 лет.\n\nЕго пришлось усыпить, поскольку животное страдало от р',
     por: 'A saúde de Sudan, de 45 anos, piorou significativamente nas últimas horas, pelo que a equipa da reserva natural onde vivia decidiu abatê-lo.\n\nSudan, o último rinoceronte-branco-do-norte macho, morreu nesta segunda-feira aos 45 anos. A informação foi avançada pela reserva natural queniana de Ol Pejeta, onde o animal vivia desde 2009. Com a saúde de Sudan a deteriorar-se de dia para dia, a reserva natural tomou a decisão de abatê-lo, conforme explica em comunicado. Agora há apenas duas f',
     ita: 'LONDRA - Era l\'ultimo esemplare maschio al mondo di rinoceronte bianco settentrionale: Sudan è morto a 45 anni. L\'animale, malato da tempo, non ha superato, a causa dell\'età avanzata, alcune complicazioni mediche.\n\nIl rinoceronte, che viveva insieme ad altre due femmine anziane della stessa specie nella riserva di Ol Pejeta Conservancy in Kenya, è stato addormentato definitivamente lunedì dopo che le sue condizioni si erano ulteriormente aggravate.\n\nÈ stata la stessa riserva ad annunciare la',
     hrv: 'Sudan, posljednji mužjak sjevernog bijelog nosoroga, uginuo je u ponedjeljak nakon što se mjesecima borio sa zdravstvenim komplikacijama zbog starosti. Imao je 45 godina.\n\nNjegovi skrbnici iz Kenije objavili su ga kako su ga morali uspavati nakon što mu se značajno pogoršalo stanje. Zbog degenerativnih promjena u mišićima i kostima te rana na koži Sudan više nije mogao ni stajati.\n\nTHOMAS MUKOYA/REUTERS/PIXSELL/REUTERS/PIXSELL\n\nOd cijele podvrste ovih nosoroga ostale su sada samo dvije ',
     slv: 'Nosoroga Sudana so že dlje časa zdravili zaradi različnih s starostjo povezanih težav. V zadnjih 24 urah pa se je njegovo zdravstveno stanje zelo poslabšalo, saj ni mogel niti vstati in je zelo trpel. Tako se je veterinarska ekipa odločila, da ga raje uspavajo. Drugi samec te podvrste je poginil že oktobra leta 2014.\n\n"Sudan je bil zadnji severni beli nosorog, ki se je skotil v divjini. Njegova smrt je krut simbol človeške brezbrižnosti za naravo in je razžalostila vse, ki so ga poznal' },
