  eventDate: '2018-03-30',
  title: 
   { eng: 'Zlatan Gives The Most Zlatan Interview After Dream Debut',
     fra: 'LA Galaxy: Ibrahimovic entre... et marque (déjà) un but d\'anthologie !',
     spa: '\'Le pegué así porque no quería correr\'; Zlatan explicó golazo en debut',
     por: 'Ele está com fome: Ibrahimovic faz golaço e garante virada do Galaxy no dérbi de LA',
     deu: 'Zlatan Ibrahimovic gibt MLS-Debüt für LA Galaxy mit Traumtor',
     rus: 'Ибрагимович приехал в США и забил с 33 метров',
     hrv: 'Ušao kod 1-3, zabio volej s 40 metara pa glavom za pobjedu!',
     tur: 'Zlatan Ibrahimovic ilk maçında nefis goller',
     ita: 'Ibrahimovic ha già conquistato la MLS' },
  summary: 
   { eng: 'Zlatan Ibrahimovic had the dream LA Galaxy debut and had the perfect post-match interview to go with it.\n\nWith his new team 3-1 down to an Carlos-Vela inspired Los Angeles, the charismatic Swede entered the fray as a substitute in the 71st minute.\n\nChris Pontius struck a minute later to bring the scoreline to 3-2 and then Zlatan did his thing.\n\nThe 36-year old bagged an insane looping half-volley to equalise and couldn\'t contain his emotion, whipping off his shirt and celebrating wildly.\n\nHe wasn',
     fra: 'Zlatan Ibrahimovic a signé son arrivée en MLS en inscrivant un premier but fantastique samedi dans le derby californien entre son club, le Los Angeles Galaxy, et le Los Angeles FC. Le Suédois, à peine entré en jeu, a égalisé à 3-3 d\'un superbe tir lobé lointain. Et à quelques secondes du coup de sifflet final, il a inscrit le but de la victoire. Splendide!\n\nLa conquête de l\'Amérique démarre sur les chapeaux de roue pour Zlatan Ibrahimovic! Arrivé jeudi en Californie, présenté vend',
     spa: 'Los Ángeles, California, EE.UU. (AFP) -\n\nTan claro y frontal como siempre ha sido, Zlatan Ibrahimovic explicó cómo fue que pensó el golazo que anotó en el partido de Los Angeles Galaxy este sábado frente al LAFC, en el que su equipo remontó para ganar 4-3 con dos dianas suyas.\n\nLa estrella sueca dijo que el clima insoportable le llevó a tomar la decisión de disparar de media cancha para "no correr y no gastar energía".\n\n"Siento que jugué 40 partidos en estos 20 minutos. Fue por culpa d',
     por: 'Ele avisou que estava com fome. Mas ninguém tinha ideia do quão faminto o leão estava. Com pouco mais de 20 minutos em campo, Ibrahimovic fez dois gols, um deles de quase do meio-campo, garantiu a vitória por virada do LA Galaxy por 4 a 3 após ver o LA FC abrir 3 a 0 e foi a figura do primeiro dérbi de Los Angeles da história (assista abaixo ao dois gols do craque).\n\nIbrahimovic estreia pelo LA Galaxy com golaço\n\nMenos de 48 horas depois de desembarcar nos EUA, Zlatan Ibrahimovic começou',
     deu: 'Zlatan Ibrahimovic debütiert in der MLS für LA Galaxy und sorgt nach seiner Einwechslung für die Wende zu Gunsten der LA Galaxy und lässt die Fans jubeln.\n\nZlatan Ibrahimovic hat in der MLS für die LA Galaxy ein Traum-Debüt gefeiert.\n\nDer Schwede wurde in seiner ersten Partie für Galaxy im Stadtderby gegen Los Angeles FC in der 71. Minute beim Stand von 1:3 aus Sicht von Galaxy eingewechselt. Zwei Minuten später gelang dem Team des Schweden der 2:3-Anschlusstreffer in Person von Chris Pon',
     rus: 'lagalaxy / Instagram\n\nНападающий Златан Ибрагимович отметился дублем в первом матче в составе клуба американской Главной лиги футбола (MLS) "Лос-Анджелес Гэлэкси". Видеозапись опубликована в Instagram-аккаунте команды.\n\nНа 77-й минуте встречи с клубом "Лос-Анджелес" Ибрагимович нанес удар с ',
     hrv: 'Čuo sam da viču \'Želimo Zlatana\', pa sam im dao Zlatana, rekao je Zlatan Ibrahimović nakon debija za Los Angeles Galaxy u kojem je napravio nešto što samo on može.\n\nPrilagodba? Ma možete takvu riječ do sutra tražiti u Zlatanovu rječniku, nećete je pronaći. Nakon samo jednog treninga, Ibrahimović je debitirao i - dominirao. Nisu Šveđani bezveze stavili riječ \'zlataner\' u rječnik, a ona znači upravo - dominacija.\n\nUšao je u igru u 71. minuti, Los Angeles Galaxy gubio je 3-1 od L',
     tur: 'Los Angeles Galaxy forması giyen Ibrahimovic, çıktığı ilk maçta enfes bir gole imza attı. Takımının 3. ve 4. golünü kaydeden Ibrahimovic, taraftarlarına \'ben buradayım\' mesajı verdi.\n\nAmerikan Birinci Futbol Ligi (MLS) takımlarından Los Angeles Galaxy\'e transfer olan Zlatan Ibrahimovic, çıktığı ilk maçta iki gol atarak takımına galibiyeti getirdi.\n\nGeçtiğimiz günlerde Manchester United\'dan ABD\'nin Los Angeles Galaxy takımına transfer olarak futbol dünyasında büy',
     ita: 'Lo svedese ha commentato il suo debutto da urlo nel campionato statunitense, condito da una doppietta che ha portato i Galaxy alla vittoria: "È stato fantastico".\n\nZlatan Ibrahimovic ha già messo le mani sulla Major League Soccer. Il centravanti svedese ieri ha debuttato nel campionato statunitense con la maglia dei Los Angeles Galaxy e ha fatto capire a tutti quanti che ora c\'è un nuovo sceriffo in città.\n\nL\'ex giocatore del Manchester United è entrato al 71esimo minuto, quando il risultato' },
