  eventDate: '2018-04-14',
  title: 
   { eng: 'SpaceX to Launch NASA\'s Exoplanet-Hunting Spacecraft Today: How to Watch Live',
     fra: 'Le télescope spatial TESS va scruter les exoplanètes à la recherche d\'une vie extraterrestre',
     spa: 'Lanzado con éxito el nuevo buscador de mundos habitables TESS',
     deu: '"Tess": Neues Nasa-Weltraumteleskop gestartet - SPIEGEL ONLINE - Wissenschaft',
     zho: 'NASA系外行星探測器將升空 尋找生命可能 | 世界萬象 | 全球 | 聯合新聞網',
     por: 'NASA lançará novo telescópio em busca da Terra 2.0',
     rus: 'NASA запустит спутник для поиска экзопланет' },
  summary: 
   { eng: 'After a delay, SpaceX is winding up again to launch NASA\'s Transiting Exoplanet Survey Satellite (TESS) today (April 18) from Cape Canaveral Air Force Station in Florida.\n\nThe 30-second launch window of SpaceX\'s Falcon 9 rocket is set for 6:51 p.m. EDT (2251 GMT), and you can watch the launch live on Space.com\'s home page, courtesy of NASA TV. After launch, the rocket\'s first stage is set to attempt a landing on the SpaceX drone ship Of Course I Still Love You.\n\nAfter it reaches space, TESS will ',
     fra: 'Sommes-nous seuls dans l\'Univers? La Nasa doit lancer dans la nuit de lundi à mardi son nouveau télescope spatial à la recherche de planètes d\'une taille comparable à celle de la Terre, et susceptibles - peut-être - d\'abriter la vie. Le Transiting Exoplanet Survey Satellite (TESS) doit être propulsé dans l\'espace à 18h32 (0h32 GMT+2) par une fusée Falcon 9 de SpaceX depuis Cap Canaveral, en Floride.\n\nD\'un coût de 337 millions de dollars, cet engin de la taille d\'une machine à laver au',
     spa: 'MADRID, 19 Abr. (EUROPA PRESS) -\n\nEl nuevo buscador de mundos habitables TESS (Transiting Exoplanet Survey Satellite) de la NASA ha sido lanzado con éxito desde Cabo Cañaveral (Florida) a bordo de un cohete Falcon 9 de Space X.\n\nEl despegue se produjo con dos días de retraso, a las 22.51 GMT del 18 de abril, por la decisión de llevar a cabo "análisis adicionales de control de navegación" tras detectarse un problema técnico.\n\nEl objetivo de esta nueva misión de la NASA será encontrar mund',
     deu: 'Das neue Weltraumteleskop "Tess" - kurz für "Transiting Exoplanet Survey Satellite" - ist auf dem Weg zu seinem Einsatzort. "Tess" habe in der Nacht zum Donnerstag erfolgreich an Bord einer "Falcon 9"-Rakete des privaten Raumfahrtunternehmens SpaceX vom Weltraumbahnhof Cape Canaveral im US-Bundesstaat Florida abgehoben, teilte die US-Raumfahrtbehörde Nasa mit. Die erste Raketenstufe landete anschließend auf einer schwimmenden Raketenplattform im Atlantik und soll wiederverwendet werden.\n\n"Tess',
     zho: '美國國家航空暨太空總署（NASA）預計明天發射一架造價3億3700萬美元的太空探測器，大小和洗衣機差不多，目標是擴增人類對太陽系外行星的探索。\n\n這枚「凌日系外行星巡天衛星」（TESS）預定明天下午6時32分（格林威治時間22時32分），由美國太空探索科技公司「獵鷹9號」（SpaceX Falcon 9）火箭載運，自佛羅里達州卡納維爾角（Cape Canaveral）發射升空。\n\n法新社報導，TESS未來兩',
     por: 'Descobrir o que habita o espaço extraterrestre é curiosidade de muita gente. E, para alegria dos interessados, a NASA não brinca em serviço. A nova empreitada da agência é o lançamento de um caçador de planetas, com a missão de encontrar a Terra 2.0. Isso mesmo: o novo telescópio será enviado à órbita e vasculhará o espaço para identificar planetas jamais catalogados.\n\nO brinquedinho da agência norte-americana atende pelo nome de TESS e é poderoso para cumprir com louvor a sua mi',
     rus: 'Спутник будет искать каменистые планеты у ближайших звезд.\n\nTESS будет наблюдать за 200 тысячами звезд © NASA\n\nВ понедельник, 16 апреля, NASA запустит спутник TESS (Transiting Exoplanet Survey Satellite), предназначенный для поиска небольших каменистых экзопланет возле ближайших к Солнцу звезд, сообща' },
