  eventDate: '2018-03-25',
  title: 
   { eng: 'Saudi Arabia intercepts missile over capital city',
     fra: 'Yémen: Jean-Yves Le Drian assume les ventes d\'armes françaises et accuse l\'Iran',
     zho: '也门叛军发射七导弹 沙特成功拦截 - 大纪元',
     deu: 'Saudi-Arabiens Rolle im Krieg: Der Jemen am Abgrund',
     spa: 'Arabia Saudita intercepta siete misiles que, asegura, fueron disparados desde Yemen',
     tur: 'Suudi Arabistan\'a balistik füze saldırısı: 1 ölü, 2 yaralı',
     rus: '"Ракеты летают постоянно"',
     por: 'Arábia Saudita intercepta mísseis disparados do Iêmen sobre Riad (VÍDEOS)',
     ita: 'Missili degli Houthi su Riad, un morto' },
  summary: 
   { eng: 'Chat with us in Facebook Messenger. Find out what\'s happening in the world as it unfolds.\n\n(CNN)Saudi Arabia\'s air force intercepted a missile over Riyadh on Sunday, according to an official with the country\'s Ministry of Information.\n\nAuthorities have not said who is behind the missile attack. Saudi Arabia has been leading a coalition of states against Iran-backed Houthi rebels in Yemen, who toppled that country\'s internationally recognized government in 2015.Between November and December of las',
     fra: 'Jean-Yves Le Drian était interrogé ce jeudi 29 mars sur la radio RTL sur la situation au Yémen et notamment les ventes d\'armes françaises à l\'Arabie saoudite qui intervient militairement dans le pays. Le ministre des Affaires étrangères a défendu la position de la France dans ce conflit et pointé la responsabilité de l\'Iran dans l\'armement des rebelles houthis.\n\nPour plusieurs organisations non gouvernementales, la population yéménite est depuis trois ans régulièrement bombardée pa',
     zho: '【大纪元2018年03月26日讯】（大纪元记者张智报导）沙特空军部队周日（25日）以爱国者飞弹在首都利雅德上空等地拦截了由也门胡塞叛军（Houthi）发射的七枚导弹，其中一导弹碎片造成一人丧生、两人受伤。\n\n沙特官方媒体报导说，正值在以沙特阿拉伯为首的联军向也门胡塞叛军发动空袭和地面行动三周年之际，也门胡塞反政府武装周日发起对沙特阿拉伯最大的一次袭击行动。',
     deu: 'Als Saudi-Arabien vor drei Jahren erstmals Luftangriffe gegen die Houthi-Miliz im Jemen geflogen hatte, war in der Hauptstadt Riad die Erwartung groß, dass der Krieg rasch beendet sein würde. Seither hat Saudi-Arabien aber keines seiner Ziele erreicht. So ist das Königreich heute nicht sicherer als im März 2015. Denn die Houthis, die 2014 im Jemen die Macht übernommen hatten, feuern heute mehr Raketen denn je nach Saudi-Arabien ab. Allein in den vergangenen Tagen hat die saudische Luftabwehr',
     spa: '(CNN) - La Fuerza Aérea de Arabia Saudita interceptó siete misiles disparados desde Yemen este domingo. Un hombre murió cuando los escombros de los misiles interceptados cayeron en un suburbio residencial, dijeron los saudíes en un comunicado.\n\nEl portavoz de las Fuerzas de la Coalición, el coronel Turki Al Maliki, dijo que los misiles fueron disparados desde Yemen a cuatro áreas objetivo y que todos los misiles fueron interceptados y destruidos, según un comunicado.\n\nEsta no es la primera',
     tur: 'Sivil Savunma\'nın Riyad bölgesindeki basın sözcüsü Muhammed el-Hamadi, Yemen\'den başkente fırlatılan balistik füzelerin havada imha edildiğini ancak parçalarının başkentin farklı yerleşim yerlerine düştüğünü belirtti.\n\nHamadi, parçaların, Mısır uyruklu kişilerin oturduğu bir eve düşmesi sonucu 1 kişinin yaşamını yitirdiği, 2 kişinin yaralandığı bilgisini paylaştı.\n\nSuudi Arabistan\'a balistik füze saldırısı\n\nBu arada Suudi Arabistan öncülüğündeki ',
     rus: 'Москва: будут нам сугробы и потопы\n\nСредства противоракетной обороны Саудовской Аравии перехватили семь баллистических ракет, выпущенных по территории королевства хуситами -- действующей в Йемене шиитской военизированной группировкой. Те, в свою очередь, пообещали подве',
     por: 'A Força Aérea saudita interceptou um míssil disparado do Iêmen em direção à parte nordeste de Riad na noite deste domingo, segundo relatos da mídia local.\n\nVárias testemunhas, incluindo jornalistas da Agência Reuters, relataram ter ouvido vários estrondos e flashes no céu pouco antes da meia-noite na capital saudita.\n\nImagens ainda não verificadas, que surgiram online, mostram uma suposta explosão no meio do ar do interceptador de vários ângulos.\n\nAlhumdillah The saudi army has su',
     ita: 'I ribelli Houthi dello Yemen hanno lanciato questa notte almeno sette missili balistici su Riad e altre città dell\'Arabia saudita. Tre ordigni sono stati intercettati dal sistema di difesa Patriot prima che colpissero la capitale. I frammenti di uno dei missili, secondo il governo di saudita, hanno ucciso una persona, e ci sarebbero anche feriti. Un filmato mostra uno dei missili Patriot lanciati per intercettare la minaccia deviare dalla rotta e schiantarsi al suolo in una tremenda esplosione.\n' },
